		if(!lotteryId){
			return -1;
		}		
		var gameType = lotteryBetTypeConfig.gameType;
		for(var i in gameType){
			if( jQuery.inArray( lotteryId, gameType[i].lotteryGroup) >=0){
				var gameTypeId = gameType[i].gameTypeId;		
				return gameTypeId;
			}
		}
		return -1;
